    doubles_res += -1.000000000000000 * einsum('kbij,ak->abij', g_abab[oa, vb, oa, ob], t1_aa)

    #	  1.0000 <a,b||c,j>_abab*t1_aa(c,i)
    doubles_res +=  1.000000000000000 * einsum('abcj,ci->abij', g_abab[va, vb, va, ob], t1_aa)

