    doubles_res +=  0.500000000000000 * einsum('kbcd,adcijk->abij', g_bbbb[ob, vb, vb, vb], t3_abbabb)

    #	 -0.2500 <l,k||c,d>_aaaa*t4_aaabaaab(c,d,a,b,i,k,l,j)
    doubles_res += -0.250000000000000 * einsum('lkcd,cdabiklj->abij', g_aaaa[oa, oa, va, va], t4_aaabaaab)

    #	  0.2500 <l,k||c,d>_abab*t4_aabbaabb(c,a,d,b,i,l,j,k)
    doubles_res +=  0.250000000000000 * einsum('lkcd,cadbiljk->abij', g_abab[oa, ob, va, vb], t4_aabbaabb)

    #	 -0.2500 <k,l||c,d>_abab*t4_aabbaabb(c,a,d,b,i,k,l,j)
    doubles_res += -0.250000000000000 * einsum('klcd,cadbiklj->abij', g_abab[oa, ob, va, vb], t4_aabbaabb)

    #	 -0.2500 <l,k||d,c>_abab*t4_aabbaabb(a,d,c,b,i,l,j,k)
