    #	  0.5000 P(i,j)<l,k||c,j>_bbbb*t3_bbbbbb(c,a,b,i,l,k)
    contracted_intermediate =  0.500000000000000 * einsum('lkcj,cabilk->abij', g_bbbb[ob, ob, vb, ob], t3_bbbbbb)
