    doubles_res +=  0.250000000000000 * einsum('klcd,cdabkjli->abij', g_abab[oa, ob, va, vb], t4_abbbabbb)

    #	 -0.2500 <l,k||d,c>_abab*t4_abbbabbb(d,c,a,b,l,j,i,k)
    doubles_res += -0.250000000000000 * einsum('lkdc,dcabljik->abij', g_abab[oa, ob, va, vb], t4_abbbabbb)

    #	  0.2500 <k,l||d,c>_abab*t4_abbbabbb(d,c,a,b,k,j,l,i)
    doubles_res +=  0.250000000000000 * einsum('kldc,dcabkjli->abij', g_abab[oa, ob, va, vb], t4_abbbabbb)

    #	  0.2500 <l,k||c,d>_bbbb*t4_bbbbbbbb(c,d,a,b,i,j,l,k)
    doubles_res +=  0.250000000000000 * einsum('lkcd,cdabijlk->abij', g_bbbb[ob, ob, vb, vb], t4_bbbbbbbb)

    #	 -1.0000 P(i,j)<k,l||c,j>_abab*t2_bbbb(a,b,i,l)*t1_aa(c,k)
    contracted_intermediate = -1.000000000000000 * einsum('klcj,abil,ck->abij', g_abab[oa, ob, va, ob], t2_bbbb, t1_aa, optimize=['einsum_path', (0, 2), (0, 1)])
