    #	  1.0000 P(i,j)<l,k||c,j>_bbbb*t2_bbbb(a,b,i,l)*t1_bb(c,k)
    contracted_intermediate =  1.000000000000000 * einsum('lkcj,abil,ck->abij', g_bbbb[ob, ob, vb, ob], t2_bbbb, t1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
