    #	  0.5000 P(i,j)<l,k||c,j>_bbbb*t2_bbbb(a,b,l,k)*t1_bb(c,i)
    contracted_intermediate =  0.500000000000000 * einsum('lkcj,ablk,ci->abij', g_bbbb[ob, ob, vb, ob], t2_bbbb, t1_bb, optimize=['einsum_path', (0, 2), (0, 1)])
