    #	 -0.5000 P(i,j)<k,l||d,c>_abab*t2_bbbb(a,b,i,l)*t2_abab(d,c,k,j)
    contracted_intermediate = -0.500000000000000 * einsum('kldc,abil,dckj->abij', g_abab[oa, ob, va, vb], t2_bbbb, t2_abab, optimize=['einsum_path', (0, 2), (0, 1)])
