    contracted_intermediate = -1.000000000000000 * einsum('klcd,al,dbij,ck->abij', g_abab[oa, ob, va, vb], t1_bb, t2_bbbb, t1_aa, optimize=['einsum_path', (0, 3), (1, 2), (0, 1)])
