    contracted_intermediate =  1.000000000000000 * einsum('lkdc,ak,dbli,cj->abij', g_abab[oa, ob, va, vb], t1_bb, t2_abab, t1_bb, optimize=['einsum_path', (0, 3), (1, 2), (0, 1)])
