    contracted_intermediate = -1.000000000000000 * einsum('lkcj,ak,bl,ci->abij', g_bbbb[ob, ob, vb, ob], t1_bb, t1_bb, t1_bb, optimize=['einsum_path', (0, 3), (0, 2), (0, 1)])
