    doubles_res +=  1.000000000000000 * einsum('lkcd,ak,bl,cj,di->abij', g_bbbb[ob, ob, vb, vb], t1_bb, t1_bb, t1_bb, t1_bb, optimize=['einsum_path', (0, 3), (2, 3), (0, 2), (0, 1)])

