    #	 -1.0000 P(j,k)f_aa(l,k)*t3_aaaaaa(a,b,c,i,j,l)
    contracted_intermediate = -1.000000000000000 * einsum('lk,abcijl->abcijk', f_aa[oa, oa], t3_aaaaaa)
