    contracted_intermediate =  1.000000000000000 * einsum('mlde,aeij,bl,cm,dk->abcijk', g_bbbb[ob, ob, vb, vb], t2_abab, t1_bb, t1_bb, t1_bb, optimize=['einsum_path', (0, 4), (0, 3), (0, 2), (0, 1)])
