    #    < 0 | i* j* k* c b a e(-T) H e(T) | 0> :

    #	 -1.0000 P(j,k)f_bb(l,k)*t3_bbbbbb(a,b,c,i,j,l)
    contracted_intermediate = -1.000000000000000 * einsum('lk,abcijl->abcijk', f_bb[ob, ob], t3_bbbbbb)
